//import QRCodeScanner from './QRCodeScanner';


function QRCodePage({card, onClose , onImageChange })
{


    const [newImage, setNewImage] = useState('');

    const handleImageChange = () => {
    // Perform any necessary logic to get the new image URL
    const newImageUrl = 'data:image/png;base64,';
    setNewImage(newImageUrl);

    // Call the onImageChange function to update the image of the specific card
    onImageChange(card.id, newImageUrl);
    };
    return(
        <div>
            <h3> QR-code of specified parking spot</h3>
            {console.log(card.id)}
            <QRCode value={`${card.id}`}/>
            <br></br>
            <button onClick={onClose}>Close</button>
            <button onClick={handleImageChange}>Scan</button>
            {/* {newImage && <img src={newImage} alt="New Image" />} */}
        </div>
    );
}



